import './index.css';
import TitleCard from "./TitleCard";
import MainPage from "./MainPage";
import CryptoCalc from "./CryptoCalcu";
import CurrResult from "./CurrResult";


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>

        <TitleCard/>
        <MainPage/>
        <CryptoCalc/>
        <CurrResult/>

    </React.StrictMode>
);
